function processResults(a){$("#iphone6plus").empty(),$("#iphone6").empty();for(var l=0;l<a.length;l++)s='<div class="col-sm-4">',s+="No"==a[l].availability?'<div class="panel panel-danger"><div class="panel-heading"><h3 class="panel-title">Unavailable</h3></div>':'<div class="panel panel-success"><div class="panel-heading"><h3 class="panel-title">Available</h3></div>',s+='<div class="panel-body">',s+="<strong>Colour:</strong> "+a[l].colour+"<br>",s+="<strong>Capacity:</strong> "+a[l].capacity+"<br>",s+="<strong>Price:</strong> $"+a[l].price+"<br>",s+="</div></div></div>","iPhone 6 Plus"==a[l].model?$("#iphone6plus").append(s):$("#iphone6").append(s)}